%[text] # Muestreo, ventanas y descomposición espectral
%%
%[text] ## Periodograma
%[text] Hacer paso a paso:
%[text] **Entrada de longitud par con tasa de muestreo**
%[text] [https://la.mathworks.com/help/signal/ug/power-spectral-density-estimates-using-fft.html](https://la.mathworks.com/help/signal/ug/power-spectral-density-estimates-using-fft.html)
fs = 1000;
t = 0:1/fs:1-1/fs;
x = cos(2*pi*100*t) + randn(size(t));

figure %[output:6528d5e7]
plot(t,x) %[output:7959334a] %[output:6528d5e7]
legend("x(t)") %[output:6528d5e7]

%[text] 
N = length(x);
xdft = fft(x);

%Solo pára ver la magnitud de la transformada de fourier
figure %[output:682bdaaf]
plot(abs(xdft)) %[output:682bdaaf]

xdft = xdft(1:N/2+1);
psdx = (1/(fs*N))*abs(xdft).^2 %[output:5227392d]
psdx(2:end-1) = 2*psdx(2:end-1);
freq = 0:fs/length(x):fs/2; %Teorema de Nyquist

plot(freq,pow2db(psdx)) %[output:028fa8d3]
grid on %[output:028fa8d3]
title("Periodograma usando FFT") %[output:028fa8d3]
xlabel("Frequency (Hz)") %[output:028fa8d3]
ylabel("PSD (dB/Hz)") %[output:028fa8d3]

%[text] 
figure %[output:8a23b6db]
periodogram(x,rectwin(N),N,fs) %[output:8a23b6db]
%[text] ![](text:image:3717)
%%
%[text] ## Muestreo
%[text] 1\.- Definir las siguientes señales y graficarlas en tiempo continuo:
%[text] $\\begin{array}{l}\nx\_1 =\\cos \\left(4\*2\\pi t\\right)+\\cos \\left(4\\ldotp 5\*2\\pi t\\right)\\\\\nx\_2 =\\cos \\left(4\*2\\pi t\\right)+\\cos \\left(8\*2\\pi t\\right)\\\\\nx\_3 =\\cos \\left(4\*2\\pi t\\right)+0\\ldotp 001\\cos \\left(8\*2\\pi t\\right)\n\\end{array}${"editStyle":"visual"}
syms t

x = cos(4*2*pi*t)+cos(4.5*2*pi*t) %Hz %[output:1f472e0d]
%[text] 2\.- Tomar muestras con 3 frecuencias de muestreo en un intervalo entre $t=\\left(0,40\\right)${"editStyle":"visual"}. Graficar las señales discretas
%[text] $\\begin{array}{l}\nf\_{\\textrm{s1}} =3\\\\\nf\_{\\textrm{s2}} =6\\\\\nf\_{\\textrm{s3}} =12\\\\\n\n\\end{array}${"editStyle":"visual"}
fs = 3; %Hz
t1 = 0:1/fs:40;

x1 = double(subs(x,t,t1));
N = length(x1) %[output:0c9da70b]

figure %[output:84738f8f]
periodogram(x1,rectwin(N),N,fs) %[output:84738f8f]

fs = 12;%Hz
t1 = 0:1/fs:40;

x1 = double(subs(x,t,t1));
N = length(x1) %[output:60604898]

figure %[output:84f44ac7]
periodogram(x1,rectwin(N),N,fs) %[output:84f44ac7]

%%
%[text] ## Ventanas
%[text] Aplicar una ventana rectangular (default), otra de alto rango dinamico y otra de alta resolución a las 3 señales anteriores con $f\_{s\\;} =100\\textrm{Hz}${"editStyle":"visual"}. Sacar el periodograma.
%[text] [https://la.mathworks.com/help/signal/ug/windows.html](https://la.mathworks.com/help/signal/ug/windows.html)
x = cos(4*2*pi*t)+0.001*cos(4.2*2*pi*t) %Hz %[output:6e475ec9]
fs = 100;%Hz
t1 = 0:1/fs:40;

x1 = double(subs(x,t,t1));
N = length(x1) %[output:0bd4965a]

figure %[output:7df7dd0d]
periodogram(x1,rectwin(N),N,fs) %[output:7df7dd0d]

figure %[output:04c282c8]
periodogram(x1,flattopwin(N),N,fs) %[output:04c282c8]
